            <NavigationItem link="/login">
               Log In
            </NavigationItem>
         </div>
      );
      const authNav = (
         null
      );
      return (
         <div className="NavigationItems">

            <NavigationItem link="/allhotels">
               All Hotels
            </NavigationItem>

            <NavigationItem link="/signup">
               Sign Up
            </NavigationItem>


            <NavigationItem link="/login">
               Log In
            </NavigationItem>
         </div>
      );
      //return isAuthenticated?authNav:guestNav;
   }
}


NavigationItems.propTypes = {
  auth: propTypes.object.isRequired,
  logUserOut: propTypes.func.isRequired
};

const mapStateToProps = (state) => ({
   auth: state.auth
});

export default connect(mapStateToProps, { logUserOut },null, {pure: false} )(NavigationItems);
